import React, { useState } from 'react';
const Tommy=()=>{
    const [num,setnum]=useState(0);
    return(
        <>
        <button onClick={()=>{
            setnum(num=1);
        }}>Click ME Guys {num}</button>
        </>
    );

};
export default Tommy;
